import React, { Component } from 'react'
import './Upload.css'

class Upload extends Component {
  constructor(props) {
    super(props)
  }

  render() {
    return (
        <div class="topnav">
        <span className="Title">Upload Files</span>
        <div className="Content">
          <div />
          <div className="Files" />
        </div>
        <div className="Actions" />
      </div>
    )
  }
}

export default Upload;
